Insert into DIM_PRODUCT (ID,PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESC,WEIGHT_CLASS,WARRANTY_PERIOD,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL,SUBCATEGORY_ID,SUBCATEGORY_NAME,SUBCATEGORY_DESC,CATEGORY_ID,CATEGORY_NAME,CATEGORY_DESC) values ('23','3359','SDRAM - 16 MB','SDRAM memory upgrade module, 16 MB. Synchronous Dynamic Random Access Memory was introduced after EDO. Its architecture and operation are based on those of the standard DRAM, but SDRAM provides a revolutionary change to main memory that further reduces data retrieval times. SDRAM is synchronized to the system clock that controls the CPU. This means that the system clock controlling the functions of the microprocessor also controls the SDRAM functions. This enables the memory controller to know on which clock cycle a data request will be ready, and therefore eliminates timing delays.','1','+00-09','102059','orderable','111','99','http://www.supp-102059.com/cat/hw/p3359.html','14','hardware4','memory components/upgrades','10','hardware','computer hardware and peripherals');
