Insert into DIM_PRODUCT (ID,PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESC,WEIGHT_CLASS,WARRANTY_PERIOD,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL,SUBCATEGORY_ID,SUBCATEGORY_NAME,SUBCATEGORY_DESC,CATEGORY_ID,CATEGORY_NAME,CATEGORY_DESC) values ('25','2276','SDRAM - 48 MB','Memory SIMM: RAM - 48 MB. SDRAM can operate in burst mode. In burst mode, when a single data address is accessed, an entire block of data is retrieved rather than just the one piece. The assumption is that the next piece of data that will be requested will be sequential to the previous. Since this is usually the case, data is held readily available.','1','+00-09','102058','orderable','269','215','http://www.supp-102058.com/cat/hw/p2276.html','14','hardware4','memory components/upgrades','10','hardware','computer hardware and peripherals');
