Insert into DIM_PRODUCT (ID,PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESC,WEIGHT_CLASS,WARRANTY_PERIOD,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL,SUBCATEGORY_ID,SUBCATEGORY_NAME,SUBCATEGORY_DESC,CATEGORY_ID,CATEGORY_NAME,CATEGORY_DESC) values ('27','3091','VRAM - 64 MB','Citrus Video RAM memory module - 64 MB capacity. Physically, VRAM looks just like DRAM with added hardware called a shift register. The special feature of VRAM is that it can transfer one entire row of data (up to 256 bits) into this shift register in a single clock cycle. This ability significantly reduces retrieval time, since the number of fetches is reduced from a possible 256 to a single fetch. The main benefit of having a shift register available for data dumps is that it frees the CPU to refresh the screen rather than retrieve data, thereby doubling the data bandwidth. For this reason, VRAM is often referred to as being dual-ported. However, the shift register will only be used when the VRAM chip is given special instructions to do so. The command to use the shift register is built into the graphics controller.','1','+00-06','102098','orderable','279','243','http://www.supp-102098.com/cat/hw/p3091.html','14','hardware4','memory components/upgrades','10','hardware','computer hardware and peripherals');
